import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { ShoppingCart, Menu as MenuIcon, MessageSquare, Moon, Sun } from 'lucide-react';

const Header = ({ cartItemsCount, onSearch, user, onLogout, toggleChat, isDarkMode, toggleTheme }) => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <header className={`${isDarkMode ? 'bg-gray-900 text-white' : 'bg-white text-gray-900'} shadow-sm sticky top-0 z-50 transition-colors duration-300`}>
      <div className="container mx-auto flex items-center justify-between p-4">
        {/* Logo */}
        <Link to="/" className="text-2xl font-bold text-green-600 hover:text-green-500 transition-colors duration-300">
          Curry
        </Link>

        {/* Search Bar */}
        <div className="flex-grow max-w-md mx-4">
          <div className="relative">
            <input
              type="text"
              placeholder="Search menu items..."
              className={`w-full pl-3 pr-10 py-2 border-gray-300 focus:ring-green-500 focus:border-green-500 block rounded-full shadow-sm ${
                isDarkMode ? 'bg-gray-800 text-white' : 'bg-white text-gray-900'
              }`}
              onChange={(e) => onSearch(e.target.value)}
            />
            <button
              type="submit"
              className="absolute inset-y-0 right-0 flex items-center px-3 rounded-r-full bg-green-600 hover:bg-green-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-green-500"
            >
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-white" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M8 4a4 4 0 100 8 4 4 0 000-8zM2 8a6 6 0 1110.89 3.476l4.817 4.817a1 1 0 01-1.414 1.414l-4.816-4.816A6 6 0 012 8z" clipRule="evenodd" />
              </svg>
            </button>
          </div>
        </div>

        {/* Navigation Links */}
        <nav className={`${isMenuOpen ? "block" : "hidden"} md:flex md:items-center md:space-x-6`}>
          <Link to="/" className="nav-item">Home</Link>
          <Link to="/menu" className="nav-item">Menu</Link>
          <Link to="/order" className="nav-item">Order</Link>
          <Link to="/track" className="nav-item">Track</Link>

          {/* User Profile and Cart */}
          {user ? (
            <div className="flex items-center space-x-4">
              <Link to="/profile" className="nav-item">Profile</Link>
              <button onClick={onLogout} className="btn-primary">Logout</button>
            </div>
          ) : (
            <Link to="/login" className="btn-primary">Login</Link>
          )}

          {/* Cart Icon */}
          <Link to="/cart" className="relative inline-block">
            <ShoppingCart className="h-6 w-6 text-gray-700 hover:text-green-600 transition-colors duration-300" />
            {cartItemsCount > 0 && (
              <span className="cart-badge">
                {cartItemsCount}
              </span>
            )}
          </Link>

          {/* Chat Support */}
          <button onClick={toggleChat} className="btn-primary flex items-center">
            <MessageSquare className="h-5 w-5 mr-1" /> Chat
          </button>

          {/* Theme Toggle */}
          <button
            onClick={toggleTheme}
            className="p-2 rounded-full bg-green-500 text-white hover:bg-green-600 transition-colors duration-300"
          >
            {isDarkMode ? <Sun size={24} /> : <Moon size={24} />}
          </button>
        </nav>

        {/* Mobile Menu Toggle */}
        <button
          className="md:hidden btn-primary"
          onClick={() => setIsMenuOpen(!isMenuOpen)}
          aria-label="Toggle menu"
        >
          <MenuIcon />
        </button>
      </div>
    </header>
  );
};

export default Header;
